import React, { useEffect, useState } from 'react';
import axios from 'axios';
import EVBarChart from './components/BarChart';

const App = () => {
  const [evByCity, setEvByCity] = useState([]);
  const [evByCounty, setEvByCounty] = useState([]);
  const [evByState, setEvByState] = useState([]);
  const [evGrowthTrend, setEvGrowthTrend] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const cityResult = await axios.get('http://localhost:5000/api/ev-by-city');
      const countyResult = await axios.get('http://localhost:5000/api/ev-by-county');
      const stateResult = await axios.get('http://localhost:5000/api/ev-by-state');
      const growthTrendResult = await axios.get('http://localhost:5000/api/ev-growth-trend');

      setEvByCity(cityResult.data);
      setEvByCounty(countyResult.data);
      setEvByState(stateResult.data);
      setEvGrowthTrend(growthTrendResult.data);
    };
    fetchData();
  }, []);

  return (
    <div>
      <h1>EV Dashboard</h1>
      <EVBarChart data={evByCity} title="EVs by City" dataKey="EV Count" xAxisKey="City" />
      <EVBarChart data={evByCounty} title="EVs by County" dataKey="EV Count" xAxisKey="County" />
      <EVBarChart data={evByState} title="EVs by State" dataKey="EV Count" xAxisKey="State" />
      <EVBarChart data={evGrowthTrend} title="EV Growth Trend by Model Year" dataKey="EV Count" xAxisKey="Model Year" />
    </div>
  );
};

export default App;
